import React from 'react';
import TextField from '@material-ui/core/TextField';
import './queryFilterPanel.css';

export default function QueryFilterPanel() {
    return (
        <div>
            <div className="queryFilterHeaderDiv">
                <h2>Filter By a Custom Query:</h2>
            </div>
            <div className="customQueryInputSection">
                <TextField className="customQueryInputField" id="outlined-basic" label="Eg. Show by age < 18" variant="outlined" />
            </div>
        </div>
    )
}
